import React, {useContext} from 'react'
import {TableContext} from '../model/context'
const Settings= ()=> {
    const [columns, setColumns, history] = useContext(TableContext)
    const keys = Object.keys(columns);
    return (
        <div>
            <form>
                {keys.map(key =>(<input type="checkbox" value={key} name={key}/>))}
            </form>
        </div>
    )
}
export default Settings;
